import React from "react";

const Header = () => {
  return (
    <header className="row">
      <a className="navbar-brand" href="/">
        <img src="./images/logo/logo.png" alt="Logo" />
      </a>
      <ul className="list-unstyled list-inline">
        <li className="list-inline-item">Home</li>
        <li className="list-inline-item">Reservation</li>
        <li className="list-inline-item">Menu</li>
        <li className="list-inline-item">About</li>
        <li className="list-inline-item">Contact</li>
        <li className="list-inline-item">Meet The Chefs</li>
      </ul>
      <ul className="list-unstyled list-inline">
        <li className="list-inline-item">font 1</li>
        <li className="list-inline-item">font 2</li>
        <li className="list-inline-item">font 3</li>
      </ul>
    </header>
  );
};

export default Header;
